  constructor(props) {
      super(props);
      this.state = {
          word: '',
          letters: 'abcdefghijklmnopqrstuvwxyz',
      }
  }

  render() {
    return (
      <div className="App">
        <Title />
        <SearchMenu />
        <Rolodex />
      </div>
    );
  }
}

export default App;
